import logotype from './logo.svg';
import './App.css';
//import AppHeader from './AppHeader';

const AppHeader = () =>{

      <a
        className="App-link"
        href="https://reactjs.org"
        target="_blank"
        rel="noopener noreferrer"
      >
        Learn React
      </a>

}
function App() {
  return (
    <div className="App">
      <AppHeader/>
    </div>
  );
}

export default App;
